import logging
from datetime import datetime
from enum import Enum
from typing import List, Dict, Optional
import uuid
import pytz

# Configure logging
logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')
logger = logging.getLogger(__name__)

class PublishStatus(Enum):
    DRAFT = "draft"
    PENDING = "pending"
    PUBLISHED = "published"
    FAILED = "failed"

class SubmissionType(Enum):
    FABS = "fabs"
    DABS = "dabs"

class User:
    def __init__(self, user_id: str, name: str, role: str):
        self.user_id = user_id
        self.name = name
        self.role = role

class Agency:
    def __init__(self, agency_id: str, name: str):
        self.agency_id = agency_id
        self.name = name

class Submission:
    def __init__(self, submission_id: str, user: User, submission_type: SubmissionType):
        self.submission_id = submission_id
        self.user = user
        self.submission_type = submission_type
        self.publish_status = PublishStatus.DRAFT
        self.created_at = datetime.now(pytz.utc)
        self.updated_at = datetime.now(pytz.utc)
        self.file_path = None
        self.errors = []

    def update_publish_status(self, status: PublishStatus):
        self.publish_status = status
        self.updated_at = datetime.now(pytz.utc)
        logger.info(f"Submission {self.submission_id} status updated to {status.value}")

    def add_error(self, error: str):
        self.errors.append(error)
        logger.warning(f"Error added to submission {self.submission_id}: {error}")

class FABSSubmission(Submission):
    def __init__(self, submission_id: str, user: User):
        super().__init__(submission_id, user, SubmissionType.FABS)

    def validate(self):
        logger.info(f"Validating FABS submission {self.submission_id}")
        # Simulate validation logic
        if not self.file_path:
            self.add_error("No file uploaded")
            return False
        return True

class DABSSubmission(Submission):
    def __init__(self, submission_id: str, user: User):
        super().__init__(submission_id, user, SubmissionType.DABS)

    def validate(self):
        logger.info(f"Validating DABS submission {self.submission_id}")
        if not self.file_path:
            self.add_error("No file uploaded")
            return False
        return True

class BrokerSystem:
    def __init__(self):
        self.submissions: Dict[str, Submission] = {}
        self.agencies: List[Agency] = []

    def create_submission(self, user: User, submission_type: SubmissionType) -> Submission:
        submission_id = str(uuid.uuid4())
        if submission_type == SubmissionType.FABS:
            submission = FABSSubmission(submission_id, user)
        else:
            submission = DABSSubmission(submission_id, user)
        self.submissions[submission_id] = submission
        logger.info(f"Created {submission_type.value} submission {submission_id} for user {user.name}")
        return submission

    def publish_submission(self, submission_id: str) -> bool:
        if submission_id not in self.submissions:
            logger.error(f"Submission {submission_id} not found")
            return False

        submission = self.submissions[submission_id]
        if submission.publish_status != PublishStatus.DRAFT:
            logger.warning(f"Submission {submission_id} is not in draft status")
            return False

        if not submission.validate():
            submission.update_publish_status(PublishStatus.FAILED)
            return False

        submission.update_publish_status(PublishStatus.PENDING)
        logger.info(f"Publishing submission {submission_id}...")
        # Simulate publishing process
        try:
            # Processing logic here
            submission.update_publish_status(PublishStatus.PUBLISHED)
            return True
        except Exception as e:
            submission.add_error(str(e))
            submission.update_publish_status(PublishStatus.FAILED)
            logger.error(f"Failed to publish submission {submission_id}: {str(e)}")
            return False

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

    def process_deletions(self, deletion_date: str):
        logger.info(f"Processing deletions for {deletion_date}")
        # Simulate deletion processing
        date_obj = datetime.strptime(deletion_date, "%m-%d-%Y")
        for sub_id, submission in list(self.submissions.items()):
            if submission.created_at.date() == date_obj.date() and submission.publish_status == PublishStatus.FAILED:
                del self.submissions[sub_id]
                logger.info(f"Deleted submission {sub_id}")

    def add_agency(self, agency: Agency):
        self.agencies.append(agency)
        logger.info(f"Added agency {agency.name}")

